sys_variable_value.value:
(function execute(inputs, outputs) {
    var serviceRecord = new GlideRecord(inputs.service_table_name);
    serviceRecord.addQuery('name',inputs.service_name);
    serviceRecord.query();
    
    if (serviceRecord.next()){
        outputs.status='update';
        serviceRecord.setValue('name',inputs.service_name);
        serviceRecord.setValue('table',inputs.service_case_table_name);
        outputs.service_record_id = serviceRecord.update();
    }else{
        outputs.status='new';
        serviceRecord.setValue('name',inputs.service_name);
        serviceRecord.setValue('table',inputs.service_case_table_name);
        serviceRecord.setValue('sys_package',inputs.app_id);
        serviceRecord.setValue('sys_scope',inputs.app_id);
        outputs.service_record_id = serviceRecord.insert();
    }

})(inputs, outputs);

